    [],nt"revision_timestamp": "2016-07-27T22:21:58.769925",nt"name": "seasonal-predator-management-plan-to-increase-suck-production-on-horicon-nwr",nt"isopen":
    false,nt"url": null,nt"notes": "Horicon National Wildlife Refuge was directed
    by the 1985 Annual Work Plan Advice to increase mallard and redhead production on
    the refuge. The limiting factor on mallards and redhead production is low nesting
    success caused by mammalian predation. Nesting success must be increased by separating
    or removing the predator from the nesting habitat. Four refuge management practices
    are proposed to accomplish this goal. They are direct predator reduction, electric
    fencing, duck nesting structures and an aversive agent study. The predator management
    program is intended to ultimately increase upland duck nesting success from the
    current 10% rate to approximately 50%.",nt"license_title": "License Not Specified",nt"extras":
